import React from 'react';

const Home = (props: { name: string }) => {
    return (
        <div>
            {props.name ? 
                (
                    // If Authenticated
                    <form action="/action_page.php">
                        <input type="file" id="myFile" name="filename" />
                        <input type="submit" />
                    </form>
                )
                :
                (
                    // If not Authenticate
                    'You are not logged in'
                )
            }
        </div>
    );
};

export default Home;

